import React from 'react'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

function DisplayStatistic({data}) {
    let hasData=false
    let tmp;
    if(data!=="No Data")
    {
        tmp = JSON.parse(data)
        hasData=true
    }
  return (
    <Row>
        <Col>
        <p></p>
        <p>{hasData ? tmp.continent: "No Data"}</p>
        </Col>

    </Row>
  )
}

export default DisplayStatistic
